    firstItem: 'Пройти все уроки блока react.',
    secondItem: 'Сдать тест по react-у.'
};

const App = () => (
    <div>
        <h1>Список дел:</h1>
        <InputItem />
        <ItemList props = {props}/>
        <Footer count = {6}/>
    </div>
);

export default App;
